ALTER VIEW vw_t_event AS select `e`.`id_event` AS `id_event`,`e`.`titre` AS `titre`,`e`.`contenu` AS `contenu`,concat_ws(' ',left(`e`.`contenu`,50),'...') AS `left_contenu`,`e`.`id_type_event` AS `id_type_event`,`e`.`date_event` AS `date_event`,`e`.`deleted` AS `deleted`,`e`.`updated` AS `updated`,`e`.`user_code_upd` AS `user_code_upd`,`t`.`type_event` AS `type_event`,`e`.`photo_event` AS `photo_event`,concat_ws(' ',left(`e`.`titre`,30),'...') AS `left_titre` from (`t_event` `e` join `t_type_event` `t` on((`e`.`id_type_event` = `t`.`id_type_event`))) where ((`e`.`deleted` is null) or (`e`.`deleted` = 0)) ;



TRUNCATE t_event ;

